import style from './Header.module.css';
import Layout from "../Layout";
import Logo from './Logo';
import Search from './Search';
import Auth from './Auth';


export const Header = () => {
  return (
      <header className={style.header}>
        <Layout>
            <div className={style.divContainer}>
                <Logo/>
                <h1 style={{

                }}>Заголовок</h1>
                <Search/>
                <Auth/>
            </div>
        </Layout>
      </header>
  )
}
